import React, {Component} from 'react';
import Navigation from "./Navigation";

class Header extends Component {
    render() {
        return (
            <nav className={'nav container row justify-content-end bg-primary'}>

                <div className={''}>
                </div>

                <div className={''}>
                    <Navigation/>
                </div>

            </nav>
        );

    }
}

export default Header;
